import React, { useState } from 'react';
import {
  Dropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
} from 'reactstrap';
import PropTypes from 'prop-types';
import rangeSlider from 'range-slider-input';
import 'range-slider-input/dist/style.css';
import { Slider, RangeSlider, Row, Col, InputGroup, InputNumber } from 'rsuite';


const valuesArr=[]
  function Example2(props) {
    console.log('First PROPS- ',props.products.price)


    let i = 0;




    for (let i = 0; i < props.products.length; i++) {
      console.log('props.products.price= ',props.products[i].price);
      valuesArr.push(Number(props.products[i].price))
    }


    console.log('Array values prices = ',typeof(valuesArr),valuesArr)


    const lowestValue = Math.min(...valuesArr);
    console.log('MIN= ',lowestValue)

    const highestValue = Math.max(...valuesArr);
    console.log('MAX= ',highestValue)

    const [value, setValue] = React.useState([10, 50]);
    return (<>
      <Row>

          <RangeSlider
            progress
            style={{ marginTop: 16 }}
            value={value}
            onChange={value => {
              setValue(value);
            }}
          />

      </Row>
      <br /><br />
      <Row>
        <Col >
          <InputGroup>
            <InputNumber
              min={0}
              max={100}
              value={value[0]}
              onChange={nextValue => {
                const [start, end] = value;
                if (nextValue > end) {
                  return;
                }
                setValue([nextValue, end]);
              }}
            />
            <InputGroup.Addon>to</InputGroup.Addon>
            <InputNumber
              min={0}
              max={100}
              value={value[1]}
              onChange={nextValue => {
                const [start, end] = value;
                if (start > nextValue) {
                  return;
                }
                setValue([start, nextValue]);
              }}
            />
          </InputGroup>
        </Col>
        </Row>
        </>
    );
  }




export default Example2;
